import React, {useEffect, useState} from "react";
import {ContainerCard} from "../containerCard/ContainerCard.js";

const initialState = {
  containers: [],
};

export function ContainerCardDeck(containers) {
  // const [state, setState] = useState(initialState);

  setState({...state, containers});

  const myPromisse = new Promise(containers).then(console.log(myPromisse));

  useEffect(() => {
    async function f() {
      const containers = await containers;
      console.log(containers);
    }
    f();
  }, []);

  console.log(containers);

  return (
    <div>
      {state.containers.map((container) => (
        <ContainerCard container={container} />
      ))}
    </div>
  );
}
